import React from "react";
import LeftContentStyle from "./LeftContentStyle"

import LeftList from "./LeftList/LeftList"
import LeftListActive from "./LeftListActive/LeftListActive"



class LeftContent extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
          ListActive: []
        };
      }

     handleAdd = (title,count) => {
        console.log("Add: ",title,"Count: ",count)
        console.log("ListActive: ",this.state.ListActive)
        //this.state.ListActive.push({title: title,count: count})
        //var ListActive = this.state.ListActive
        //ListActive.push({title: title,count: count});

        this.setState({ ListActive: [...this.state.ListActive, {title: title,count: count}] })


        //joined.push({title: title,count: count});
        //let ListActive = [...this.state.ListActive];
        //ListActive.push({title: title,count: count})
       // this.setState({ListActive: ListActive})
     }

      render() {
        return (
            <LeftContentStyle>
                <LeftList handleAdd={this.handleAdd}/>
                <LeftListActive ListActive={this.state.ListActive}/>
            </LeftContentStyle>
        )
      }
}


export default LeftContent;
